def get_executable_directory():
    if getattr(sys, 'frozen', False):
        # 如果是打包后的 exe 文件，返回其所在目录
        return os.path.dirname(sys.executable)
    else:
        # 如果是脚本方式运行，则返回当前脚本所在的目录
        return os.path.dirname(os.path.abspath(__file__))
        
class SudokuGenerator:
    """简易数独生成器示例，真实环境建议用更复杂算法"""
    def generate(self, difficulty='简单'):
        base = 3
        side = base * base

        # 生成完整数独解（固定模板+随机置换）
        def pattern(r,c): return (base*(r%base)+r//base+c)%side
        def shuffle(s): return random.sample(s,len(s))
        rBase = range(base)
        rows  = [g*base + r for g in shuffle(rBase) for r in shuffle(rBase)]
        cols  = [g*base + c for g in shuffle(rBase) for c in shuffle(rBase)]
        nums  = shuffle(range(1,side+1))

        board = [[nums[pattern(r,c)] for c in cols] for r in rows]

        squares = side*side
        empties = {'入门':24,'简单':34, '中等':44, '困难':54, "专家": 64}.get(difficulty, 30)
        for p in random.sample(range(squares), empties):
            board[p//side][p%side] = 0
        return board

    def solve(self, board):
        """用回溯法求解数独，返回解的拷贝"""
        def is_valid(b, r, c, n):
            for i in range(9):
                if b[r][i] == n: return False
                if b[i][c] == n: return False
            br, bc = 3*(r//3), 3*(c//3)
            for i in range(br, br+3):
                for j in range(bc, bc+3):
                    if b[i][j] == n: return False
            return True

        def backtrack(b):
            for i in range(9):
                for j in range(9):
                    if b[i][j] == 0:
                        for n in range(1,10):
                            if is_valid(b, i, j, n):
                                b[i][j] = n
                                if backtrack(b):
                                    return True
                                b[i][j] = 0
                        return False
            return True

        copy_board = [row[:] for row in board]
        if backtrack(copy_board):
            return copy_board
        else:
            return None

