    def _add_thick_borders(self, panel):
        # 使用一个覆盖层的画布绘制粗边框实现3x3宫格区分
        # 也可以逐个cell设置边框，但这里方便演示
        self.border_panel = wx.Panel(panel, pos=(10,10), size=(540,540))
        self.border_panel.SetBackgroundStyle(wx.BG_STYLE_PAINT)
        self.border_panel.Bind(wx.EVT_PAINT, self.on_paint_borders)
        self.border_panel.Hide()  # 临时隐藏，后面布局后show

        # 注意这里和cells的布局坐标关系：grid_sizer控件大小固定，稍微对齐即可
        # 由于用的GridSizer，布局会自动调整，后续调整

    def on_paint_borders(self, event):
        dc = wx.PaintDC(self.border_panel)
        dc.SetPen(wx.Pen(wx.Colour(0,0,0), 3))
        size = self.border_panel.GetSize()
        w, h = size.GetWidth(), size.GetHeight()
        cell_w = w / 9
        cell_h = h / 9

        # 画粗边框线，3x3小格分界线
        for i in range(10):
            pen_width = 3 if i % 3 == 0 else 1
            dc.SetPen(wx.Pen(wx.Colour(0,0,0), pen_width))
            x = i * cell_w
            y = i * cell_h
            dc.DrawLine(x, 0, x, h)
            dc.DrawLine(0, y, w, y)

    def on_char(self, event):
        key = event.GetKeyCode()
        if key >= ord('1') and key <= ord('9'):
            event.Skip()
        elif key in (wx.WXK_BACK, wx.WXK_DELETE, wx.WXK_LEFT, wx.WXK_RIGHT, wx.WXK_TAB):
            event.Skip()
        else:
            # 过滤掉其它输入
            return

    def on_timer(self, event):
        if self.start_time:
            elapsed = time.perf_counter() - self.start_time
            self.elapsed_label.SetLabel(f"用时：{elapsed:.3f} 秒")
            
    def on_generate(self, event):
        difficulty = self.difficulty_combo.GetValue()
        self.current_board = self.generator.generate(difficulty)
        self.current_solution = self.generator.solve(self.current_board)
        self.answer_shown = False
        self.btn_toggle_answer.SetLabel("显示答案")
        self._update_grid(self.current_board)
        self.start_time = time.perf_counter()
        self.timer.Start(100)  # 每 100ms 更新一次

    def _update_grid(self, board):
        for i in range(9):
            for j in range(9):
                val = board[i][j]
                tc = self.cells[i][j]
                if val == 0:
                    tc.SetValue("")
                    tc.SetEditable(True)
                    tc.SetForegroundColour(wx.BLACK)
                else:
                    tc.SetValue(str(val))
                    tc.SetEditable(False)
                    tc.SetForegroundColour(wx.BLUE)
        self.Refresh()

    def get_user_inputs(self):
        user_inputs = [[0 for _ in range(9)] for _ in range(9)]
        for row in range(9):
            for col in range(9):
                if self.current_board[row][col] == 0:  # 空格，用户可以填写
                    value = self.cells[row][col].GetValue()
                    if value.isdigit():
                        user_inputs[row][col] = int(value)
        return user_inputs


    def on_toggle_answer(self, event):
        if self.answer_shown:
            # 隐藏答案，显示题目
            #self._update_grid(self.current_board)
            self.btn_toggle_answer.SetLabel("显示答案")
            self.answer_shown = False
            if hasattr(self, "dlg") and self.dlg :
                self.dlg.Close()
        else:
            # 显示答案
            #self._update_grid(self.current_solution)
            self.btn_toggle_answer.Disable()
            self.answer_shown = True
            user_inputs = self.get_user_inputs()
            self.timer.Stop()
            elapsed_time = time.perf_counter() - self.start_time if self.start_time else 0
            self.dlg = AnswerDialog(self, self.current_solution, user_inputs, self.current_board, elapsed_time)
            
            self.dlg.ShowModal()
            self.dlg.Destroy()
            self.answer_shown = False
            #self.btn_toggle_answer.SetLabel("显示答案")
            self.btn_toggle_answer.Enable()
            self.timer.Start()

