    def export_pdfs(self, difficulties, question_pdf_path, answer_pdf_path):
        cell_size = 20
        box_w = cell_size * 9
        box_h = cell_size * 9
        margin_x = 18
        margin_y = 30
        h_gap = 10
        v_gap = 20
        cols = 3
        rows = 4
        c_width, c_height = A4
        question_pdf = canvas.Canvas(question_pdf_path, pagesize=A4)
        answer_pdf = canvas.Canvas(answer_pdf_path, pagesize=A4)

        def draw_board(c, board, pos_x, pos_y, index=None, difficulty=None):
            c.setLineWidth(1)
            for i in range(10):
                line_w = 1 if i % 3 == 0 else 0.2
                c.setLineWidth(line_w)
                # 横线
                c.line(pos_x, pos_y + i * cell_size, pos_x + box_w, pos_y + i * cell_size)
                # 竖线
                c.line(pos_x + i * cell_size, pos_y, pos_x + i * cell_size, pos_y + box_h)

            if index is not None:
                c.setFont("Helvetica-Bold", 12)
                stars = star_map.get(difficulty, "")
                # 题号与星号放在格子上方，左边移开，避免数字重叠
                c.drawString(pos_x, pos_y + box_h + 5, f"{index + 1}:{stars}")

            c.setFont("Helvetica", 10)
            for r in range(9):
                for cc in range(9):
                    val = board[r][cc]
                    if val != 0:
                        c.drawCentredString(
                            pos_x + cc * cell_size + cell_size / 2 + 2,
                            pos_y + box_h - r * cell_size - cell_size + 2,
                            str(val)
                        )
        q_y = c_height - margin_y + 10
        margin_y += 10
        question_pdf.setFont("STSong-Light", 12)
        question_pdf.drawString(margin_x, q_y, txt_title)
        answer_pdf.setFont("STSong-Light", 12)
        answer_pdf.drawString(margin_x, q_y, txt_title)
        total = len(difficulties)
        for idx, diff in enumerate(difficulties):
            board = self.generator.generate(diff)
            solution = self.generator.solve(board)

            col_idx = idx % cols
            row_idx = (idx // cols) % rows

            if idx > 0 and idx % (cols * rows) == 0:
                question_pdf.showPage()
                answer_pdf.showPage()

            q_x = margin_x + col_idx * (box_w + h_gap)
            q_y = c_height - margin_y - (row_idx + 1) * box_h - row_idx * v_gap
            draw_board(question_pdf, board, q_x, q_y, idx, diff)
            
            a_x = margin_x + col_idx * (box_w + h_gap)
            a_y = c_height - margin_y - (row_idx + 1) * box_h - row_idx * v_gap
            draw_board(answer_pdf, solution, a_x, a_y, idx, diff)
            
            if idx > 0 and (idx +1) % (cols * rows) == 0:
                # 计算位置：X靠右（减去文字宽度），Y靠下
                x = c_width - margin_x - text_foot_width
                y = 8
                question_pdf.setFont("STSong-Light", 8)
                question_pdf.drawString(x, y, txt_foot)
                answer_pdf.setFont("STSong-Light", 8)
                answer_pdf.drawString(x, y, txt_foot)

        # 计算位置：X靠右（减去文字宽度），Y靠下
        x = c_width - margin_x - text_foot_width
        y = 8
        question_pdf.setFont("STSong-Light", 8)
        question_pdf.drawString(x, y, txt_foot)
        answer_pdf.setFont("STSong-Light", 8)
        answer_pdf.drawString(x, y, txt_foot)
        
        question_pdf.save()
        answer_pdf.save()
        
